import { View, Text } from "react-native-web";
import { styles } from "../assets/styles/Styles";


function AccountScreen() {
    return (
      <View style={styles.container}>
        <Text>Movimientos</Text>
        
      </View>
    );
  }

  export default AccountScreen;
